import React, {Component} from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import './Purchase.css';
import Navigation from '../Navigation/Navigation';

class Purchase extends Component
{
    render()
    {
        return(
            <div className="Purchase">

                <Navigation/>

                <h1>Purchase</h1>

            </div>
        )
    }
}

export default Purchase;
